import React from 'react';

const Menu = ({ menuItems }) => {
  return (
    <div className='section-center'>
      {menuItems.map((item) => {
        const { id, title, desc, image } = item;
        return (
          <article key={id} className='menu-item'>
            <img src={image} alt='IMAGE' />
            <div className='item-info'></div>
          </article>
        );
      })}
    </div>
  );
};

export default Menu;
